Sweetheart is pushing the boundaries of lesbian love-making again with Strap-On Specialists. Dani and Dana are lovers who need something extra to help keep their love life spontaneous. Kara and Hayden finally take a much needed break from studying to learn something new about themselves. Kami and Sinn are two friends away at college who get a special care package from their girlfriends back home. Aiden wants to teach her daughter's friend, Leilani, something about experimentation.

Dani Daniels &amp; Dana DeArmond, Kara Price &amp; Hayden Winters, Kami Li &amp; Sinn Sage, Leilani Leeane &amp; Aiden Starr

